import React, { Component } from "react";

export default class Card extends Component {
  render() {
    const { title, img, description } = this.props;
    return (
      <div className="card-container">
        <div className="card-head">
          <div className="card-profile">
            <img src={img} className="card-profile-image" />
            <div className="card-profile-name">
              <p className="uploader-name">sikandar</p>
              <p className="time-before">2 hours ago</p>
            </div>
          </div>
          <h3 className="card-title">{title}</h3>
        </div>
        <div className="card-body">
          <img src={img} className="post-image" />
        </div>
        <div className="card-footer">{description}</div>
        <hr className="line"></hr>
        <div>
          <p>sjdhsjad</p>
        </div>
      </div>
    );
  }
}
